class Solution {

    /**
     * @param Integer[] $heights
     * @param Integer[][] $queries
     * @return Integer[]
     */
    function leftmostBuildingQueries($heights, $queries) {
        $n = count($heights);
        $ans = array_fill(0, count($queries), -1);

        foreach ($queries as $index => $query) {
            [$a, $b] = $query;
            if ($a == $b) {
                $ans[$index] = $a;
                continue;
            }

            $meet = false;
            $maxHeightFromA = $heights[$a];
            $maxHeightFromB = $heights[$b];
            $leftmostFromA = PHP_INT_MAX;
            $leftmostFromB = PHP_INT_MAX;

            // Find the leftmost meeting point from A
            for ($i = $a + 1; $i < $n; $i++) {
                if ($heights[$i] > $maxHeightFromA) {
                    $maxHeightFromA = $heights[$i];
                    $leftmostFromA = min($leftmostFromA, $i);
                    if ($i == $b || $maxHeightFromA >= $maxHeightFromB) {
                        $meet = true;
                        break;
                    }
                }
            }

            // Find the leftmost meeting point from B, if needed
            if (!$meet) {
                for ($j = $b - 1; $j >= 0; $j--) {
                    if ($heights[$j] > $maxHeightFromB) {
                        $maxHeightFromB = $heights[$j];
                        $leftmostFromB = min($leftmostFromB, $j);
                        if ($j == $a || $maxHeightFromB >= $maxHeightFromA) {
                            $meet = true;
                            break;
                        }
                    }
                }
            }

            if ($meet) {
                $ans[$index] = min($leftmostFromA, $leftmostFromB);
            }
        }

        return $ans;
    }
}
